import React ,{Component} from "react";

class Counter extends Component{
    constructor(props){
        super(props);
        this.state={
            count:2
        }
    }

    render(){
        return (
          <div>
           <p>This is the count : {this.state.count}</p>
           <button>Inc</button>
           <button>Dec</button>
          </div>
        )
      }
}

export default Counter;
